          {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Rob Garneau",\n            "author_url" : "https://www.google.com/maps/contrib/104898905503493544295/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-StFtKDYrZyA/AAAAAAAAAAI/AAAAAAAAYw0/lmk8rTzR8LA/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "4 months ago",\n            "text" : "Food is pretty good here. All you can eat buffet. Great place to go when you''re hungry. Instant gratification. It''s never crowded and always easy to get a seat. I''m not sure how they stay in business. Nothing fancy with the atmosphere. Small TVs are usually playing some kind of dance with music from India. Kind of cheesy.",\n            "time" : 1470417106\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Vamshi Krishna",\n            "author_url" : "https://www.google.com/maps/contrib/111212108572432280312/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-QVDHMOcZ2mc/AAAAAAAAAAI/AAAAAAAAAF8/c1ybSsxGA4E/photo.jpg",\n            "rating" : 1,\n            "relative_time_description" : "2 weeks ago",\n            "text" : "We took two biryanis and haven''t even finished one. Rice was not cooked properly it was like oiled fried rice. \\n",\n            "time" : 1480922079\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Nishant Rakesh",\n            "author_url" : "https://www.google.com/maps/contrib/100448424514881407102/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-SMKD_FOl77U/AAAAAAAAAAI/AAAAAAAAFRc/SqjwWhvDCrU/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "2 months ago",\n            "text" : "Good food, easy to get parking and never crowded. Typical indian food. If you looking to eat a lot then it''s buffet is best bet",\n            "time" : 1475513949\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Jeremy Joly",\n            "author_url" : "https://www.google.com/maps/contrib/113529193362456964761/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-sYeubJlI5_Y/AAAAAAAAAAI/AAAAAAAAAQ8/pmBDl7FFxEA/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "3 weeks ago",\n            "text" : "So damn good! But go for dinner, food is fresher at dinner time!",\n            "time" : 1480702103\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Derik Vo",\n            "author_url" : "https://www.google.com/maps/contrib/106318286058253753146/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-OaUd_GQLGW4/AAAAAAAAAAI/AAAAAAAACHQ/zbSNLVmdVkg/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "10 months ago",\n            "text" : "The buffet option is your best bet to have a good time. Food is average, but I enjoyed everything. I don''t know any of the names of the dishes so I can''t describe what anything taste like. The only dish i know we''re tandoori chicken and buttery chicken curry, which both were good. Both taste like what you get anywhere, but had consistency in distribution of flavor. \\n\\nThe buffet option has a rule where you have to have three different dishes with the same portions, so you can''t just pick one dish to eat. On the bright side each dish comes with naan.\\n\\nOver all this place is a nice lunch spot to hang out with friends. ",\n            "time" : 1456102314\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "restaurant", "food", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=3861006764433150392",\n      "utc_offset" : -480,\n      "vicinity" : "1645 Flickinger Avenue, San Jose",\n      "website" : "http://www.newindiachaatcafe.us/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJF_-SVT3Mj4ARuBFrHTINlTU', 37.3904204, -121.8793679, 1, 0, NULL, 0, 'new-india-chaat-cafe-ChIJF_-SVT3Mj4ARuBFrHTINlTU', 0, '2016-12-26 07:44:31'),
