      "author_url" : "https://www.google.com/maps/contrib/116398791467666785932/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-F5HjPHcl8cY/AAAAAAAAAAI/AAAAAAAABFc/R5AYgiqC2yA/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "Good food super friendly service. It''s really clean and they have a buffet",\n            "time" : 1477775333\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "gurnam singh",\n            "author_url" : "https://www.google.com/maps/contrib/112126752043667046732/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "6 months ago",\n            "text" : "I am Indian, I eat Indian food everyday. This place is very authentic, the food is always fresh and very tasty. Prices are very reasonable. Owners are always very nice and helpful. I had them catered for my daughters birthday party and everything was just amazing.",\n            "time" : 1465505125\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Gary B",\n            "author_url" : "https://www.google.com/maps/contrib/108614779782457586188/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "2 months ago",\n            "text" : "We went there on a very busy Saturday night. There was lot going on in the kitchen(it''s a open kitchen).\\nWe were seated right away. We ordered some chicken malai kebab and samosa to begin with. For main course we ordered Lamb Rohan Josh, Chicken Tikka Masala, Goat Briyani few vegetarian dishes and some naans. Food was simply amazing. We asked for food to be mild to medium, spice level was good, food was fresh, piping hot and very flavorful. Vegetable rice had all fresh vegetables unlike other places which uses frozen ones.\\nI have tried all other restaurants in the area this one is my new favorite.",\n            "time" : 1477237732\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Lashkar Singh",\n            "author_url" : "https://www.google.com/maps/contrib/100199264477670373382/reviews",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "2 months ago",\n            "text" : "Super Nasty!!!!! Chef got one spoon and he tastes food from every pan before serving to you without washing it.. basically licking your food and then served. NEVER COMiNG BACK!! ",\n            "time" : 1475900496\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "restaurant", "food", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=15964392457286718438",\n      "utc_offset" : -480,\n      "vicinity" : "15106 Harlan Road, Lathrop"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJedZuw2oVkIAR5hOAX1vqjN0', 37.8243364, -121.2873297, 1, 0, NULL, 0, 'rasoi-ChIJedZuw2oVkIAR5hOAX1vqjN0', 0, '2016-12-26 07:44:31'),
