HEk/AAAAAAAAAAI/AAAAAAAAAYE/3vpN8do0nAs/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "4 months ago",\n            "text" : "This is a well-run hotel. I was driving south from Portland on July 30th and found The Courtyard to be a very welcoming place to get some rest. I arrived at almost 9 pm, and Anne was on hand to serve up a delicious, made-in-front-of-me tuna fish sandwich and a refreshing drink. Anne was good company and made me laugh. It is clear she takes pride in her work. \\n\\nMy room was just what I needed. The mattress was surprisingly comfy and the whole place was very clean.\\n\\nThank you Courtyard Stockton. I would stay again without hesitation.",\n            "time" : 1470313551\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "will schmetzer",\n            "author_url" : "https://www.google.com/maps/contrib/105812166288839132465/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-tia5Fk0cdnk/AAAAAAAAAAI/AAAAAAAABgQ/jKhKrRRw97M/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "4 months ago",\n            "text" : "Quick service from the joyful staff at the front desk. The king size bed was soft and I got a great sleep. Typical styling for a Marriott which is classy but uses \\"hotel art\\". The is a Starbucks inside so no complementary breakfast.",\n            "time" : 1471010076\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Jean Lin",\n            "author_url" : "https://www.google.com/maps/contrib/114566858213075918762/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-YlxOgIgi6WA/AAAAAAAAAAI/AAAAAAAAAik/c6AFSbTyqMM/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "Nice and clean rooms. Good gym. Great service",\n            "time" : 1477558172\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "lodging", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=12209022714461483702",\n      "utc_offset" : -480,\n      "vicinity" : "3252 West March Lane, Stockton",\n      "website" : "http://www.marriott.com/hotels/travel/sckst-courtyard-stockton/?scid=bb1a189a-fec3-4d19-a255-54ba596febe2"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJTQO6_4EOkIARtvIm_ngpb6k', 37.9835051, -121.3542297, 1, 0, NULL, 0, 'courtyard-stockton-ChIJTQO6_4EOkIARtvIm_ngpb6k', 0, '2016-12-26 07:44:31'),
