he movies. I say this because the parking can be a pain since it is shared with bass pro and other nearby businesses/restaurants. The line for tickets, not bad. Line for popcorn, drinks, nachos, etc? One dad and his son were in line for 45 min. I was in line for 30 minutes. Although they had 3 cashiers... Still took more than it should have. Almost missed the beginning of my movie. Good thing we arrived early otherwise our group wouldn''t of been able to get good seats and get our food barely on time as the previews ended.",\n            "time" : 1473472746\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "RANDY LANE",\n            "author_url" : "https://www.google.com/maps/contrib/106580483399848160255/reviews",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "2 weeks ago",\n            "text" : "The theater was nice when it first opened but has quickly gone down hill. The seats were not cleaned it looked like someone had vomited on most of them and others looked like kids spilled ice cream and icee drinks on them. It was so gross that my wife complained and they said they are planning to clean them in the future, she wanted a refund and to get away from there.",\n            "time" : 1481222877\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Ansel Cliatt II",\n            "author_url" : "https://www.google.com/maps/contrib/116462385736110590296/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-uSKkSUP6VvE/AAAAAAAAAAI/AAAAAAAAAI8/kJFkjGZqk6s/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "a month ago",\n            "text" : "Great theater. Really big and good customer service. Only reason for 4 star is they haven''t ugraded to the reclining seats yet.",\n            "time" : 1479186231\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "turbotat5274",\n            "author_url" : "https://www.google.com/maps/contrib/108304826450515912549/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-gqS_FIBSNVo/AAAAAAAAAAI/AAAAAAAAAeQ/uEuuBrH8ZbA/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "4 months ago",\n            "text" : "Theatre is always clean, restrooms are pretty near always clean, the staff has always been courteous and helpful.  I like this place.  Even the parking lot is nice.  The spaces are wide enough so you almost never have to squeeze by mirrors in order to get to your door, and the lots are patrolled so you don''t have break-ins.  There are 16 theaters, so the place can really jump on the weekends, and the staff is hustling and trying to keep a smile on.  I visit 3-4 times per month, and I like it.  If there was closer attention to the popcorn oil/salt stations (and hot dog dressings) then it would have been 4.5 stars from me.",\n            "time" : 1472268619\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Damian Tanner",\n            "author_url" : "https://www.google.com/maps/contrib/116872537269999061651/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-x1-fBsZ_EKk/AAAAAAAAAAI/AAAAAAAAB1U/vUauN3TzPIA/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a week ago",\n            "text" : "Nice place to catch a movie. Never have a problem with noise from other people. ",\n            "time" : 1481644981\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "movie_theater", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=4077731342697922082",\n      "utc_offset" : -480,\n      "vicinity" : "848 Lifestyle Street, Manteca",\n      "website" : "https://www.amctheatres.com/movie-theatres/san-francisco/amc-showplace-manteca-16"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJ74oi-flAkIARIn78Kg0Dlzg', 37.780834, -121.227185, 1, 0, NULL, 0, 'amc-showplace-manteca-16-ChIJ74oi-flAkIARIn78Kg0Dlzg', 0, '2016-12-26 07:44:31'),
