n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Michael Nunez",\n            "author_url" : "https://www.google.com/maps/contrib/111643975873886886456/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "2 months ago",\n            "text" : "First Time trying this place tonight. The most amazing place I have tried in a while. Great Service, Amazing Food, Staff is amazing, Owner is Wonderful. Nothing but Love in that place. I Love it.",\n            "time" : 1477196057\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Tonya Bentulan",\n            "author_url" : "https://www.google.com/maps/contrib/113291148766561505227/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "4 months ago",\n            "text" : "Mama Weber''s is one of those rare gems in which it''s not just the food that is amazing; it''s the experience as a whole. Mama Weber is very hospitable and with a big personality, our waiter was cool as well. The restaurant has a lot of character!  You''ll definitely leave with a full tummy and smile on your face!  ",\n            "time" : 1470188529\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "William Sherman",\n            "author_url" : "https://www.google.com/maps/contrib/112168501806187491560/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/--4i2MgJZrOg/AAAAAAAAAAI/AAAAAAAAAM8/21ucjiUspj8/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "3 weeks ago",\n            "text" : "Well if you are really lucky they may just let you sit next to the Pit and enjoy some very good aroma and history of there family cooking .",\n            "time" : 1480476438\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Chris F",\n            "author_url" : "https://www.google.com/maps/contrib/108236202457977689976/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "2 weeks ago",\n            "text" : "The ribs are the best I''ve had at any bbq place. Mama Weber has great hospitality. ",\n            "time" : 1481427648\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "restaurant", "food", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=7606132181801328578",\n      "utc_offset" : -480,\n      "vicinity" : "823 South Mellon Avenue, Manteca",\n      "website" : "http://www.mamawebers4bbq.com/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJA8M4VQdBkIARwl_vmutojmk', 37.7906391, -121.2110461, 1, 0, NULL, 0, 'weber-s-bbq-more-ChIJA8M4VQdBkIARwl_vmutojmk', 0, '2016-12-26 07:44:31'),
