   }\n            ],\n            "author_name" : "jennifer jackson",\n            "author_url" : "https://www.google.com/maps/contrib/105084702756868118319/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "in the last week",\n            "text" : "I go at least once a month and it''s excellent food, amazing service & great atmosphere. The only negative thing I can say is everyone knows it''s tremendous so sometimes there is a great wait. And yet I wait, it''s worth it for me.",\n            "time" : 1482113809\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Lindsey Conrad",\n            "author_url" : "https://www.google.com/maps/contrib/102131535169963804468/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-nZdL4KCK7kc/AAAAAAAAAAI/AAAAAAAAapE/HWMtfj8c__U/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "3 months ago",\n            "text" : "Hands down best Mexican food around! Cute restaurant, has a bar, and is nicely decorated. The customer service is good. My favorite is the chicken tacos!!! Made with juicy shredded chicken with a wonderful flavor and not all greasy like a regular fried taco you''d get in a regular Mexican restaurant.",\n            "time" : 1472567231\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Kim Dale",\n            "author_url" : "https://www.google.com/maps/contrib/106389247342246509112/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "3 weeks ago",\n            "text" : "Fantastic food!!! We regularly make the drive from Stockton to eat here. The Manteca specialties are ALL delicious, but my favorite is the Chicken with Chipotle Cream sauce!",\n            "time" : 1480533195\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Karen Gonzalez",\n            "author_url" : "https://www.google.com/maps/contrib/102495471450043094825/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-vbpMOdDL6NI/AAAAAAAAAAI/AAAAAAAAAAA/x-Gr_R7WAd4/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "5 months ago",\n            "text" : "Another favorite of mine. Large portions  (I always have leftovers). The prices have increased a bit but I''m happy to say that the food quality and portions haven''t decreased. Free chips (corn and flour) and salsa. The interior is always nice and well-kept. ",\n            "time" : 1467434694\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Rebecca Schembri",\n            "author_url" : "https://www.google.com/maps/contrib/114961775778620739155/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-K2TII7W66Rg/AAAAAAAAAAI/AAAAAAAAKB4/Phkfz27PBJg/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "7 months ago",\n            "text" : "Delicious food!! The service here is excellent with every staff member smiling and greeting me warmly. I have eaten here twice and I live out of town. I now have a FAVORITE restaurant to visit when I come back! I am a foodie and very particular about restaurants.  This one gets my five stars! El Jardin put a smile on my face.  â™¡",\n            "time" : 1464205054\