ridge and a microwave.  There was only 1 think I didn''t like about this hotel was the access to my car. There was no close access to my car.  Breakfast was better than expected.  Small size gym but wasn''t planning on using it. Pool looks smaller than pic shown online.",\n            "time" : 1468963371\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Riles K",\n            "author_url" : "https://www.google.com/maps/contrib/115073416294262152679/reviews",\n            "language" : "en",\n            "rating" : 4,\n            "relative_time_description" : "in the last week",\n            "text" : "Great room. Terrible AC and heating in room 209. I put the heat on and it kicked out cold air.",\n            "time" : 1482129507\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Dave Beilstein",\n            "author_url" : "https://www.google.com/maps/contrib/112161742196304921021/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "in the last week",\n            "text" : "Friendly staff, clean rooms & a great breakfast! Gotta have the pancakes!",\n            "time" : 1482111946\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Brayden Larwill",\n            "author_url" : "https://www.google.com/maps/contrib/104983766677467647772/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-fhNNd3RSQQc/AAAAAAAAAAI/AAAAAAAAgcs/f-OLPl6vnj0/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "4 weeks ago",\n            "text" : "Extremely friendly and helpful service. I would gladly stay here again.",\n            "time" : 1480197711\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "lodging", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=13234095063001552856",\n      "utc_offset" : -480,\n      "vicinity" : "3000 Constitution Drive, Livermore",\n      "website" : "https://www.ihg.com/holidayinnexpress/hotels/us/en/livermore/lvmre/hoteldetail?cm_mmc=GoogleMaps-_-EX-_-USA-_-LVMRE"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJPxSbJpnoj4AR2Ff1sVfzqLc', 37.7039527, -121.8175599, 1, 0, NULL, 0, 'holiday-inn-express-suites-livermore-ChIJPxSbJpnoj4AR2Ff1sVfzqLc', 0, '2016-12-26 07:44:31'),
