   "type" : "overall"\n               }\n            ],\n            "author_name" : "Tamara Farhat",\n            "author_url" : "https://www.google.com/maps/contrib/108496098296923738842/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-h_9HOr9ywew/AAAAAAAAAAI/AAAAAAAAKFM/cEBWL4rlAqc/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a year ago",\n            "text" : "Walking through Burlingame I was drawn by a little pink place that smelled like heaven! and it also tastes like heaven! Kara''s Cupcake is by far the best cupcakes in town, make that the world.\\nThe flavor are so rich and mouthwatering. Their mini cupcakes are perfect for a little tasting session of your own. Don''t miss out on this heavenly place. It will make your soul happy! Trust me.\\n\\n",\n            "time" : 1434932665\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Dee M",\n            "author_url" : "https://www.google.com/maps/contrib/107415605722746623329/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-DQd9JgkbsqA/AAAAAAAAAAI/AAAAAAAAtZA/hRbkocpsL4M/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "2 years ago",\n            "text" : "Devilishly delicious treats are served here. They offer gluten free if you want something guilty-free. I was looking forward to a very guilty pleasure, and left with a dark chocolate sinful delight.",\n            "time" : 1403457729\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Bhavana Chawla",\n            "author_url" : "https://www.google.com/maps/contrib/110481542726430924556/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-8cx5zJKwH1M/AAAAAAAAAAI/AAAAAAAAAPk/qPPoyjAsYgA/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a year ago",\n            "text" : "The best cupcakes I have ever had! The gluten free are delicious also. ",\n            "time" : 1422473777\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Valeriebunny",\n            "author_url" : "https://www.google.com/maps/contrib/111690500822495361799/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-YgrAunKAi6s/AAAAAAAAAAI/AAAAAAAAANg/wyAYegMlIKQ/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "3 years ago",\n            "text" : "The cupcakes there are the cutest things. They have a speacial \\"Cupcake of the month\\" and in march, it was a Saint Patty''s Cupcake. Very cute. They have a different vaierty of cupcakes with filllings or no filling. Also have interesting flavors like Passion Fruit, or normal like Chocolate. They really delicious too, but the frosesting is a little to thick for me. Other thatn that you should go and try them! The staff is patient and nice too. ",\n            "time" : 1362945106\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "bakery", "food", "store", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=4138046451924682599",\n      "utc_offset" : -480,\n      "vicinity" : "1309 Burlingame Avenue, Burlingame",\n      "website" : "http://www.karascupcakes.com/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJs5Nfn_Gdj4ARZ0cJ31JLbTk', 37.578192, -122.3471652, 1, 0, NULL, 0, 'kara-s-cupcakes/ChIJs5Nfn_Gdj4ARZ0cJ31JLbTk', 0, '2016-12-26 07:44: