nes in the store feels superficial. They don''t carry higher-grade meats, and this store loses an extra star for me, because I was told by the butchers that \\"there''s no such thing\\" as USDA Prime brisket. Wrong. I could hardly keep from laughing out loud at them. Alternatively, you can waltz over to Costco in Livermore and buy several legit Prime beef cuts any day of the week, and Costco''s organic produce is hands-down fresher and more flavorful.",\n            "time" : 1478448973\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Oisin McGuigan",\n            "author_url" : "https://www.google.com/maps/contrib/111537116196874614857/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-XMESvtV5fSQ/AAAAAAAAAAI/AAAAAAABR-I/va-1K95LMw8/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "2 months ago",\n            "text" : "Well run store. My only complaint is that they don''t have enough check outs open after 5pm during week days. People returning home want to feed their families and not be hanging around in a store line.",\n            "time" : 1475339533\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 1,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Ram Gadilli",\n            "author_url" : "https://www.google.com/maps/contrib/109397138345200657252/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-F6_Im-Ola5k/AAAAAAAAAAI/AAAAAAAAFec/E0OJj15O8g0/photo.jpg",\n            "rating" : 3,\n            "relative_time_description" : "a month ago",\n            "text" : "I usually go safeway for refill water bottles, much faster than wal-mart.",\n            "time" : 1479627831\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Cyrus F",\n            "author_url" : "https://www.google.com/maps/contrib/118148565031547784858/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-fkgQ50iL7CQ/AAAAAAAAAAI/AAAAAAAAAP0/GkKpMzCR5Cw/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "2 months ago",\n            "text" : "Always busy even passed midnight. Friendly and helpful staff. Great deals on ice creams most of the times. ",\n            "time" : 1475913950\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Sarah Furrer",\n            "author_url" : "https://www.google.com/maps/contrib/107168125672894228700/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "3 weeks ago",\n            "text" : "always a good experience. Helpful employees",\n            "time" : 1480801700\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [\n         "grocery_or_supermarket",\n         "bakery",\n         "liquor_store",\n         "florist",\n         "food",\n         "store",\n         "point_of_interest",\n         "establishment"\n      ],\n      "url" : "https://maps.google.com/?cid=5216574018817987435",\n      "utc_offset" : -480,\n      "vicinity" : "1701 Santa Rita Road, Pleasanton",\n      "website" : "http://local.safeway.com/ca/pleasanton-1502.html?utm_source=G&utm_medium=Maps&utm_campaign=G+Places"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJpeUAAQzpj4ARa5MteG7-ZEg', 37.6749003, -121.8743494, 1, 0, NULL, 0, 'safeway/ChIJpeUAAQzpj4ARa5MteG7-ZEg', 0, '2016-12-26 07:44:31