kBE",\n      "price_level" : 4,\n      "rating" : 4.8,\n      "reference" : "CmRRAAAAz8JJtJqEjD8-gBKaFujGA0fnLlaE23Unps9lZLYrl5303PqT4XL6yPVT2ybyBD7ijEBwMJbT_WC6_dl1HsNma2lKjoMX_v3HlwX4LkekrBJ1jlXRRNPkqkUw-MHP_xKiEhADVFz1Z18148ewiajL7POuGhQV8uya2BS3pBSw-2vClk_ap7B3Wg",\n      "reviews" : [\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Jane Reiser Williams",\n            "author_url" : "https://www.google.com/maps/contrib/113858581328415745931/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "5 months ago",\n            "text" : "0 friends\\n 5 reviews\\n5.0 star rating 7/4/2016\\nMary was beyond helpful and pleasant. She came through with everything I asked for and did so with an upbeat attitude and a really sincere interest. I was ordering from Michigan to be sent to a business in Milpitas, an hour from her store. I asked for a partially custom design, an invoice sent via email, and a photo of the design. She was more than willing to do all and followed through. I also asked the next day if the order had been delivered and she checked on it for me. She answered every email promptly and also every phone call. I could not have been more pleased, given the long distance order, and the recipient was thrilled, and said the cookies, shared with his colleagues, were pronounced delicious by everyone.",\n            "time" : 1467637914\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Noemi Valerie D. Basler",\n            "author_url" : "https://www.google.com/maps/contrib/118235932545166585143/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/-h6UlH0nPjJI/AAAAAAAAAAI/AAAAAAAAAEg/N8i-EQTDvkY/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a week ago",\n            "text" : "Excellent cookies!  My husband and daughter prefer Cookies by Design cookie boutrays to a birthday cake!",\n            "time" : 1481655746\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Fawn Mosier",\n            "author_url" : "https://www.google.com/maps/contrib/116017400686652660462/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-ew5SGVw5kf0/AAAAAAAAAAI/AAAAAAAAADM/Ap9TL1kKlbk/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "6 months ago",\n            "text" : "Quick delivery.  Easy on-line order process.  Nice value.  Easy to customize order.  Wonderful experience for both purchaser and recipient.",\n            "time" : 1466957616\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Jean Raymond",\n            "author_url" : "https://www.google.com/maps/contrib/113389847137943860338/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "7 months ago",\n            "text" : "The cookies ordered were huge and delicious!  The entire family was impressed with the quality and the presentation.  I highly recommend Cookies By Design in Pleasanton, CA.",\n            "time" : 1464195680\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Mindy Sue",\n            "author_url" : "https://www.google.com/maps/contrib/107