 {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Siyang Qiu",\n            "author_url" : "https://www.google.com/maps/contrib/106169481920462981618/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-8Fx_fF8HoCQ/AAAAAAAAAAI/AAAAAAAADNY/nNtQEjgEvtg/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "3 weeks ago",\n            "text" : "Pros:\\n*Comfortable beds (far better than most other hotels)\\n*Clean\\n*Full service\\n*Lounge with some light finger food for Gold status and above. Sometimes they randomly give you access at check in anyway if the line was longer than a coupe of people.\\nCons:\\n*Many hotels have bigger rooms or have suites\\n*Small lobby area to work if you don''t like writing from your room\\n*You can''t bring outside food to eat in the lobby area because of the restaurant. Only the lobby area has chairs, tables, etc.",\n            "time" : 1480484802\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Amy Short",\n            "author_url" : "https://www.google.com/maps/contrib/109886283912152477059/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "2 weeks ago",\n            "text" : "I recently attended a corporate meeting. The facility is very nice. The breakfast and lunch provided was very good. The staff was attentive. ",\n            "time" : 1481091013\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Patrick D",\n            "author_url" : "https://www.google.com/maps/contrib/105579822565310953199/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-J1BZHXM5z4g/AAAAAAAAAAI/AAAAAAAAABA/Ise_c6JkzSI/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "2 weeks ago",\n            "text" : "Very nice experience loved it.. every year the service gets better... I loved the mashed potatoes my margarita was perfect. ",\n            "time" : 1480989138\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "T Faulk",\n            "author_url" : "https://www.google.com/maps/contrib/108167407530511125170/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "3 weeks ago",\n            "text" : "Tan is the man. Ellen is also amazing. Concierge is convenient. The room is comfortable and clean",\n            "time" : 1480398297\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Tony D",\n            "author_url" : "https://www.google.com/maps/contrib/105625997810277740257/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-_EA-b2Z2yK4/AAAAAAAAAAI/AAAAAAAAAAA/LdjKUbHo8DU/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "I love this place! I go there every year for the Biletnikoff foundation and I can''t say enough about it! Such great food and wonderful service! Thank you!!",\n            "time" : 1478620914\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "lodging", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=109149