          "profile_photo_url" : "//lh3.googleusercontent.com/-jK4F4kGZPDo/AAAAAAAAAAI/AAAAAAABBUw/wRoRBmIwRS4/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "The name is a bit misleading for this little gem. While their beer selection is great, the bar selection does not end there and neither does the decor. Wine and liquor are prominently featured. We also enjoyed delicious burgers and fries with dipping sauces and stellar service. There''s plenty of seating outside in the front and along the side. ",\n            "time" : 1479757403\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "David Yarnevich",\n            "author_url" : "https://www.google.com/maps/contrib/108504380924081274057/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-q9Zq0lB8D1c/AAAAAAAAAAI/AAAAAAAAO9M/j_ZXvL68iTo/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "This place came out on fire. The tap selection is solid. Terrific service and food, despite limited kitchen equipment. They were just about to upgrade the kitchen, so I can''t wait to see what they do next.",\n            "time" : 1478450089\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Ian Shaw",\n            "author_url" : "https://www.google.com/maps/contrib/110427565993512404359/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-f7YnRr07XoM/AAAAAAAAAAI/AAAAAAABDbw/w_vEEf-6EzI/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "a month ago",\n            "text" : "Great selection of whiskey''s and presentable as flights too. Very clean, modern aged look and comfortable feel. Heck out the ceiling once you''ve managed to stop staring at the vast array of bottles behin the bar. ",\n            "time" : 1479737614\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Katherine Miller",\n            "author_url" : "https://www.google.com/maps/contrib/106471818708323401804/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "3 months ago",\n            "text" : "Love, love, love the new Beer Baron in Pleasanton!!! This place is beautifully designed and the staff is always welcoming and helpful. The cocktails are AMAZING! No artificial tasting, overly sweet drinks here, just well made flavorful drinks made with all the good stuff:) My favs are the Juice Joint and the Whiskey Baron, Yummm! I''m not a beer drinker but hubby reported that their craft beers were super unique and all delicious. Best of all, they have awesome food. I seriously crave their burger and duck fat fries. Best burger I''ve ever had, cooked perfectly. Gotta try this place!!!''",\n            "time" : 1474688960\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 1,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Justin McKell",\n            "author_url" : "https://www.google.com/maps/contrib/112080652876828185469/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-WRApunAf9rM/AAAAAAAAAAI/AAAAAAAAUQU/JL1rYi-7LI4/photo.jpg",\n            "rating" : 3,\n            "relative_time_description" : "a month ago",\n            "text" : "The menu was very limited. The food was decent but I expected more options. There were some things in the menu that were available on top of that.",\n            "time" : 1479016389\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "bar", "restaurant", "food", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=4134510528484047138",\n      "utc_offset" : -480,\n      "vicinity" : "336 Saint Mary Street, Pleasanton",\n      "website" : "http://www.beerbaronbar.com/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJZVJ5BqPpj4ARInlnimu7YDk', 37.662496, -121.875628, 1, 0, NULL, 0, 'beer-baron-bar-kitchen/ChIJZVJ5BqPpj4ARInlnimu7YDk', 0, '2016-12-26 07:44:31'),
