AAAJzua3xQk9sHJ3AmAzd6bsAqxwgWiA3NFJsysMKGDHBXLQKfCCcXb6zzOBAhjxsRM-qFWKF_2L054Y8CtWTWd2GnGqjRywkuVx5RNY6icxACN7CFOl4MZAF0OKpJJXXe0PpwU61a1Z6fMeAdcaknyr51Mdr637D7aYnYTa1uziX4EhD8pGbv0hKyIuOtRQX3m16VGhRtb1-EQFVkBSR8AEDz3RS3aHa_Og",\n            "width" : 4032\n         },\n         {\n            "height" : 2988,\n            "html_attributions" : [\n               "\\u003ca href=\\"https://maps.google.com/maps/contrib/105898154520494127038/photos\\"\\u003eRobert Silva\\u003c/a\\u003e"\n            ],\n            "photo_reference" : "CoQBdwAAAEp4tW3qwu4Sl_tC1VDRGblgQ75lpVx0yph4VP3bjan9paAIP66C6XW3WWWE3USXN6cnALH5OxulDS6FYhCebDx3MEEJ_M93obrETRdb1UKoqpwmhYxHJUkqz8puU2Q_dG0CeBhPNHmtc_GnSglVf8uM4n_VdxQ1Ir1dxk4ali2FEhD9iJOkAugrSzkY2eCvbOw8GhSRM-PVAPab2FZyM5s8MOxa8dhPAw",\n            "width" : 5312\n         },\n         {\n            "height" : 608,\n            "html_attributions" : [\n               "\\u003ca href=\\"https://maps.google.com/maps/contrib/109596372929449638445/photos\\"\\u003eBlue Agave Club\\u003c/a\\u003e"\n            ],\n            "photo_reference" : "CoQBdwAAANm376VsJoV37MUZp9qzwyXkXU6008K1KWfD79aXPiPHzQfO7GdcsUHp8xzYDI5Vi5K5kmP6Hjq35sJtpf80nhCSwvKF1CIucULJaEeUw6mah9GsiAsI82-HjYPV6RUaZJ4HuFsD4oW_dS1ke-Gs_XX0l-8vjh8Aht-V6QdcD4NeEhBdvmPjD9wWTc8DgZu6hO-IGhQ213oxHkMLBkygrxqP5iBZoyFMhQ",\n            "width" : 1080\n         }\n      ],\n      "place_id" : "ChIJvetFGqPpj4ARoGOTFBCgtv4",\n      "price_level" : 2,\n      "rating" : 3.8,\n      "reference" : "CmRSAAAAuC9PGiWErFWzIP7w-D-BU318gpSAGou67LCU30D1ynfFaySepPIUSoJAk9-QEvlOtHj8Xh3Wh1mR824-3HiQlbr5eDdOs9IXIDj7W_mev6obbK2JbyIV8SCfpaWdzVW4EhDcDaSt5ORtI5P4sKKVU4xAGhS-re33VBmKJHSkyCnircTXJBM6pQ",\n      "reviews" : [\n         {\n            "aspects" : [\n               {\n                  "rating" : 1,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Austin S. Lin",\n            "author_url" : "https://www.google.com/maps/contrib/109948565925906176911/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-NT7-uNBwPzE/AAAAAAAAAAI/AAAAAAAAyCA/4bcCoCRD8iQ/photo.jpg",\n            "rating" : 3,\n            "relative_time_description" : "4 months ago",\n            "text" : "Average taste at best. You won''t have an awful experience here, but neither will you be rushing to spread the news to your friends and family. \\n\\nFood options are creative and unique, but no one individual flavor jumps out. Portions are hearty and overall food quality is pretty solid. For the price per person (~$30 pp including tax, tip, drinks) you can likely find a more cost-equivalent alternative.\\n\\nThe terrine is a fun mix beans, veggies and protein and honestly about on par with what you might pull together at the Whole Foods hot bar. Trinity enchiladas were a little overpowered by the cheese and sauce, although adding steak contributed to additional texture.\\n\\nImpressive tequila list, though, and the customize-your-own-margarita option is great.\\n",\n            "time" : 1470034241\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Matt Clower",\n            "author_url" : "https://www.google.com/maps/contrib/114842790827115101473/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "An upscale Mexican restaurant if the heart of downtown Pleasanton, Blue Agave offers a unique, delicious twist on classic Mexican dishes, as well as a Mexican twist on classic grilled steak and seafood dishes. I have tried almost every dish on the menu and can say everything here is delicious. If you''re in the market for just a simple burrito, this may not be a place to go, but if you''re looking for a perfectly cooked fillet smothered in delicious pomegranate chipotle sauce (usually available in the winter) on a bed of garlic mashed potatoes, then give this place a try.\\n\\nThe waiters, and everyone behind the scenes are the absolute best, and will make sure you have a good meal.\\n\\nOne thing I haven''t seen mentioned is their occasional (~quarterly) prix fixe tequila tastings out on their back patio. Reserve in advance and get a designated driver, these aren''t to be missed. This is where the chef (who is fantastic) individually pairs unique dishes with a flight of tequilas. This is frequently a testing ground for potential menu items (looking at you, apple pie), and every item is unique. Learn about new tequilas, and have a great time doing it.\\n\\nFinally, if I could give them a 6th star for making the apple pie a permanent menu item, and bringing back the bananas foster (get it with vanilla ice cream instead of coconut) on their dessert menu, I would.\\n\\nDo yourself a favor and try Blue Agave next time you''re looking for a place to celebrate.\\n\\nAll-around, my favorite restaurant. Full stop.",\n            "time" : 1480007868\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 1,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Tom Hassler",\n            "author_url" : "https://www.google.com/maps/contrib/111160497834502893187/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-j2-pclKH84A/AAAAAAAAAAI/AAAAAAAAA-g/sUdnsjaebXk/photo.jpg",\n            "rating" : 3,\n            "relative_time_description" : "4 months ago",\n            "text" : "The food didn''t impress me and didn''t live up to the hype.  Service was excellent and it''s has nice atmosphere.  But I''ve had better authentic mexican food at many other places that have less accolades and even a few that focus on gringo food.",\n            "time" : 1470357495\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Matt Thomas",\n            "author_url" : "https://www.google.com/maps/contrib/113945891994432900910/reviews",\n            "language" : "en",\n            "rating" : 4,\n            "relative_time_description" : "2 months ago",\n            "text" : "Ceviche was wonderful. Nice patio. Large tequila selection. Good salsas. Good portion sizes.",\n            "time" : 1475985548\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Dale Robinson",\n            "author_url" : "https://www.google.com/maps/contrib/102354680269129518350/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-W4uNaEz9mwo/AAAAAAAAAAI/AAAAAAAAYPg/xWJrX666KJE/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "5 months ago",\n            "text" : "Tequila selection is massive and the margaritas are made well. Food is unique and full of flavor. Try to sit outside as the atmosphere is much better there (there is live music too)!",\n            "time" : 1469496692\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "restaurant", "food", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=18354033322320159648",\n      "utc_offset" : -480,\n      "vicinity" : "625 Main Street, Pleasanton",\n      "website" : "http://blueagaveclub-hub.com/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJvetFGqPpj4ARoGOTFBCgtv4', 37.6619991, -121.8755721, 1, 0, NULL, 0, 'blue-agave-club/ChIJvetFGqPpj4ARoGOTFBCgtv4', 0, '2016-12-26 07:44:31'),
