d Coin Car Wash\\u003c/a\\u003e"\n            ],\n            "photo_reference" : "CoQBdwAAAPClnbqd1e4Q12VGgD5GWm2sxOR8XuKUBoyYbJV6YrVTu6lZ1oc4guhW8WcUbje3kAXFFdcLAB6O8HZq-rSsKA3Pd_NjtCgToc3kT80jUrsHn5jRGh9AHdqErKWWBh5VAbPVJ6D537AtDAgpHN5jdhX8ObEjMZbmB6vQC5WlMYIbEhDAmsoJFqhqiNkbiiHXFhRzGhTrZcdWD2lD_u0JZMtld_oml8i07Q",\n            "width" : 1800\n         }\n      ],\n      "place_id" : "ChIJ71l6FNryj4AR81Hp5aWJFuE",\n      "rating" : 4.1,\n      "reference" : "CmRSAAAAAhFEzZoozC-pVq-E9-emszhSF7W9CF0AWqi_v7B1ecjyJ6xGjNaErnGdPgd-P-VhDR7EJwd3gejasyMj1OJ3gPxP5kODIq8rFmqgZXnCzCkY8SdMZzTEbMqMssjQZWf_EhBry9WSN8xmJ8uXy7LnsliHGhRklyDC0ZRrhBIwg-MvnRDxFVhcyw",\n      "reviews" : [\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Zi Lin Sim",\n            "author_url" : "https://www.google.com/maps/contrib/115560484895904670380/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-dk49okvrFbs/AAAAAAAAAAI/AAAAAAAAJjk/tSxvKMnj3iE/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "4 months ago",\n            "text" : "It was a little crowded when I got there so I had to wait about 15 min. That was surprising to me since I was there at 1:30pm on a weekday, didn''t think there would be so many people washing their cars at that time! The system was really straightforward and I liked that they had towels that you can purchase. One thing to note: they use tokens \\"gold coins\\" and not cash so make sure you bring small bills, otherwise you''ll end up with a bunch of gold coins. I would like it better if they had a token changer at each bay, but I can see why that would be costly for the owners.",\n            "time" : 1470208840\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Denny Bulcao, Jr.",\n            "author_url" : "https://www.google.com/maps/contrib/108921724090859695347/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-Mycfit_OGfw/AAAAAAAAAAI/AAAAAAAACbs/zbEAfvrtUig/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "a month ago",\n            "text" : "Never had a wait and everything works well. Great wash and spray wax for $4! Dun.",\n            "time" : 1477784736\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 1,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Andrew Cain",\n            "author_url" : "https://www.google.com/maps/contrib/109075366869308156692/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-V-JjUalmKKI/AAAAAAAAAAI/AAAAAAAAARE/RKbuoHK8C7I/photo.jpg",\n            "rating" : 3,\n            "relative_time_description" : "a month ago",\n            "text" : "Wash my car like a tweeker every time! Gotta love what a buck buys your these days.",\n            "time" : 1478042206\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 1,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Spikeehair",\n            "author_url" : "https://www.google.com/maps/contrib/112543943046078004566/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-9SUj1USDoNc/AAAAAAAAAAI/AAAAAAAAWB4/n9Onft_wmb4/photo.jpg",\n            "rating" : 3,\n            "relative_time_description" : "6 months ago",\n            "text" : "The water quality here is better than Concord, so after washing, your car won''t have white marks if you didn''t dry it quickly enough. I''m still giving this place a three star since they don''t even offer filtered water for rinsing. The self wash I used to go to in Michigan had that option.",\n            "time" : 1465102319\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Bruce Curtis",\n            "author_url" : "https://www.google.com/maps/contrib/112755602389269263928/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh3.googleusercontent.com/--dD2f2_YZrQ/AAAAAAAAAAI/AAAAAAAAAw0/K6fHV9HoPiI/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "2 months ago",\n            "text" : "Quarter car wash we''ll maintained",\n            "time" : 1476993739\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "car_wash", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=16219302453641302515",\n      "utc_offset" : -480,\n      "vicinity" : "1920 San Ramon Valley Boulevard, San Ramon",\n      "website" : "http://www.goldcoincarwash.com/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJ71l6FNryj4AR81Hp5aWJFuE', 37.7855728, -121.9802259, 1, 0, NULL, 0, 'gold-coin-car-wash/ChIJ71l6FNryj4AR81Hp5aWJFuE', 0, '2016-12-26 07:44:31'),
