003eSponges Car Wash &amp; Detail Center\\u003c/a\\u003e"\n            ],\n            "photo_reference" : "CoQBdwAAAM2UmffjbDpDYCSqrhAe0DHQkDs2KNv7lW2WIKN3R-KwDaDx5jW_zdyY6GapNxozkEm9KNs8OWycO2yEMGT-i-obxNcxGuqWxyu0Gcqp25p8K3FjODJibrt7ga3wRD3wgsSGT4mH2Vec3OvttzhfgpC9GPrPmZfKa5nyDpO68FSAEhBOfiqEstdqzO1Xexi5AP_AGhR3drQPU0kCrOse1WrzBURyFKVVnA",\n            "width" : 2048\n         },\n         {\n            "height" : 1536,\n            "html_attributions" : [\n               "\\u003ca href=\\"https://maps.google.com/maps/contrib/103804172408188624675/photos\\"\\u003eSponges Car Wash &amp; Detail Center\\u003c/a\\u003e"\n            ],\n            "photo_reference" : "CoQBdwAAAKGzzXYzA7gRlZG_aCuHp2yyZ0_0CRwJQ3QRJlu-mzT7tzlrlP6_eGcqF22_7maFpXnIEspLkRuPIdppXE9O2k-BdxDeWDsSErBRWEvt4CGj5sdRXYA1Ga2vv7R-iQFbU248ZIlB0TCIkb-Thg9-Frj4a5X-pSHagpkWbcIoDovXEhBhgtYEOQbKaRXs0OFb8LIpGhR3_TeV_W6jeCETeb3cxv8dbM7-XQ",\n            "width" : 2048\n         }\n      ],\n      "place_id" : "ChIJEX-jcMLyj4ARqtSRR6GH_g4",\n      "rating" : 2.2,\n      "reference" : "CmRRAAAA2alpMYOFQ1L_gli5ncYmZnBpgTEYyxXhS4ui1WiVojLDbwghgL9q24o4lclnH7Kkq2etcoey7kaKwO0Yzp4RqnjrkyY7YSTbZnLcRSSD3m1OfUHQCG6ptAU93MKDGzl7EhA1j7U583_M90NnCat4yURMGhTw3fTawI744GFuqMGULVc6Yald6w",\n      "reviews" : [\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Antonoi Alex",\n            "author_url" : "https://www.google.com/maps/contrib/115544900351858430096/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-TQgD-0uv0YI/AAAAAAAAAAI/AAAAAAAAABE/qq_490HMeNc/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "7 months ago",\n            "text" : "I had my dog in the car with me and stopped in for a car wash. The employees were very friendly and accommodating. They even gave my dog some treats. The car wash itself was very thorough and only $13 ($10 early bird if you come before 10am). They also have a punch card where your 11th wash is free. I''ll definitely be returning here for my future car washes.",\n            "time" : 1462422441\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "A Google User",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "5 years ago",\n            "text" : "There was dirt and wax all over the vehicle after I paid them $170 to \\"detail\\" it (ironic since there was zero attention to detail). Wax and dirt in every seam on my entire jeep. They put armour all on every black painted fixture on the Jeep. I sent it back to have it cleaned properly but resorted to doing it myself in the parking lot with a rag when I was told that it would be \\"hard\\" to get all that wax out of the creases and seams. Never Never again - I totally got taken by this business. I will have to pay someone else now to \\"un-detail\\" the job they did. They left leaves in the front seat after the interior detail. Good lord.",\n            "time" : 1301881010\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "A Google User",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "6 years ago",\n            "text" : "I should have read these reviews before I bring my car here. \\nIt is more than two times expensive for the same service than San Jose Classic Car wash, and my car is not clean at all even after they said it is completed. \\nIt is worst ever car wash experience at least in Bay Area. \\nI cannot even give one star for the rating, but it does not allow me to save without star, that is why I put one star as a rating. ",\n            "time" : 1266185517\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "A Google User",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "7 years ago",\n            "text" : "I have very consistantly used Sponges to get my car cleaned.  On my last visit I had the express wax done on my Cayenne, they washed it and used some electric hand held machine to polish.  It looked great, BUT the next time I had it washed, there were really bad swirl marks all over it.  When I went back to talk to the Manager, he insisted that they did not do it and he was a total jerk.  He would not budge or work with me at all on a solution to fix.  I have ONLY ever had it washed at Sponges.\\n\\nNeedless to say they completely lost my business and I now tell any and all every chance I get not to use Sponges (go to Blackhawk instead), I understand that things happen, but I was a very loyal regular to sponges.  I ended up taking my Cayenne to a Auto Body Repair & Paint shop to get the swirls removed.",\n            "time" : 1250619534\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "A Google User",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "5 years ago",\n            "text" : "Do not go to sponges I have been there several times now hoping things would change. There is no difference between the cheapest to theist expensive car wash I was disappointed once again and I bought the 35 dollar car wash and my car was dusty inside, rims were dirty and had to remind them about the scent that comes with it. ",\n            "time" : 1302894844\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "car_wash", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=1080450087375721642",\n      "utc_offset" : -480,\n      "vicinity" : "2061 Camino Ramon, San Ramon"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJEX-jcMLyj4ARqtSRR6GH_g4', 37.7821696, -121.9699023, 1, 0, NULL, 0, 'sponges-car-wash-detail-center/ChIJEX-jcMLyj4ARqtSRR6GH_g4', 0, '2016-12-26 07:44:31');
