     "width" : 2048\n         }\n      ],\n      "place_id" : "ChIJa2J0UsXyj4AR5cK79mg92ew",\n      "reference" : "CmRSAAAAyRu-PYEgrNK5eUDVnFw34r4u3wIGs_fMVlN13Er7XA-S5W_-yvrc15h8NN1gdsPmVXTWNExLyANGEbldQD7_bvbq-rSIrcwQMjNPabIx6fAkJcK4ZCQEn9sMNV9HtEEIEhARBbGi3BVwU8tgdfdBZv2JGhSvxI6tBVA7befk0vKISqxF0p9NpQ",\n      "reviews" : [\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Di R",\n            "author_url" : "https://www.google.com/maps/contrib/100349355828971700831/reviews",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "3 years ago",\n            "text" : "I had my car detailed at this shop and they charged me $250.00 \\nI found out that whoever did detailing on my car ruined the back seat leather completely. I was pretty much shocked after John Kim showed the area to me.  \\nHe didn''t feel sorry about what happened to the leather seat or offered me for repair cost. He said that I can repair the leather seat at leather repair shop for $300 - $500 \\nI was very disappointed by their unprofessional attitudes.  Why did I ask them to detail my car in the first place ?  I will never go back to this shop for anything in the future.\\n",\n            "time" : 1378265938\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "A Google User",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "5 years ago",\n            "text" : "This shop was not professional. here was the story. I walked to  shop at around 5:00pm and only one customer was in front of me. then one guy came out to check my car to estimate the body damage. I told him that I would pay for the repair. While I was pointing to him the places I would like to fix, He suddenly asked me if I would bring the car in or I just wanted a quote for fun. I was very surprise that he was rude since we didn''t discuss very much about the cost yet. Actually, this was the first body shop I walked in. My answer was that ye, I want a quote for fun and I would repair it by myself afterward. After he said he is a busy man , he walked straight back to the store without me.\\n\\nwell, my rating to the shop is zero.",\n            "time" : 1299117710\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "A Google User",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "6 years ago",\n            "text" : "CRIMINALS!!!  Do not do business with San Ramon Body and Detail.  John Kim charged me for a part and installation which they never installed.  I asked for refund and he refused.  Also, the paint had blistered before I even took the car off the lot, and after I showed it to him, John Kim said to bring it back another day and he would take care of it.  When I called back, John Kim then flat out denied that he ever said that he would fix it.  I tried calling the owner several times and left messages with his receptionist, yet he won''t return any calls. DO NOT DO BUSINESS WITH THEM, YOU WILL REGRET IT!!!",\n            "time" : 1289868696\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "car_wash", "car_repair", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=17066739783922598629",\n      "utc_offset" : -480,\n      "vicinity" : "10 Beta Court, San Ramon"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJa2J0UsXyj4AR5cK79mg92ew', 37.781577, -121.980742, 1, 0, NULL, 0, 'san-ramon-body-detail-shop/ChIJa2J0UsXyj4AR5cK79mg92ew', 0, '2016-12-26 07:44:31'),
