placement and my struts due to their inability to correct their wrong and take responsibility to correct it. Always some excuse and always the squeaking comes back. I just don''t have time to spend every day taking it in and trying to have the problem fixed hence the noting in the computer. This way I should show history.",\n            "time" : 1474564042\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Michael Hoffman",\n            "author_url" : "https://www.google.com/maps/contrib/102671343003775696905/reviews",\n            "language" : "en",\n            "rating" : 4,\n            "relative_time_description" : "5 months ago",\n            "text" : "I needed my brakes fixed right away.  They were able to fit me in and had me going again in a couple of hours.  Polite service and I thought the price to fix my problem was good. There is also food close by if you want to eat while they work on your car or they have a waiting room.",\n            "time" : 1467574817\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Frank Dickman Jr",\n            "author_url" : "https://www.google.com/maps/contrib/108655629844898772562/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-GrPhPtLLaEg/AAAAAAAAAAI/AAAAAAAAABE/WP_4QC2cQ1E/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "7 months ago",\n            "text" : "I actually really like these guys. The prices are right and the work is just fine!",\n            "time" : 1463966075\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Stephen Urquhart",\n            "author_url" : "https://www.google.com/maps/contrib/102748531302719438878/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "11 months ago",\n            "text" : "Fast, friendly service. Prices better than other shops I''ve looked at having do the work. Quite happy with this location.",\n            "time" : 1453143239\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Sarah Galindo",\n            "author_url" : "https://www.google.com/maps/contrib/118037462146246811287/reviews",\n            "language" : "en",\n            "rating" : 2,\n            "relative_time_description" : "a year ago",\n            "text" : "I wouldn''t recommend this place. They didn''t honor coupons and then the price they gave me when I called was not the price I was charged. I wish I could find a trustworthy car repairman, this is not them. ",\n            "time" : 1447462457\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "car_repair", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=1247959569363396373",\n      "utc_offset" : -480,\n      "vicinity" : "515 East Yosemite Avenue, Manteca",\n      "website" : "http://www.brakemasters.com/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJ6Wvwga5BkIARFWf0yZ2kURE', 37.7981244, -121.2106231, 1, 0, NULL, 0, 'brake-masters/ChIJ6Wvwga5BkIARFWf0yZ2kURE', 0, '2016-12-26 07:44:31'),
