n collections. I call to make sure it was true which it was. Now the collection is chase bank it self. they called me I told them the issue and they told me so we still want the money. so now August I have a civil case against Chase for harassment. ",\n            "time" : 1471909276\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Dave Polanco",\n            "author_url" : "https://www.google.com/maps/contrib/118147178664004985229/reviews",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "4 months ago",\n            "text" : "Very rude on the phone.  Not willing to help because they claim they had 3 customers in line in their branch. I asked if I wait on hold until they finish their 3 customers they could assist me and they said no we are busy. It was a simple transaction lookup!?  I agree with the other reviewers - stay far away from this branch & their staff.",\n            "time" : 1471372274\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Ann Cramphorn",\n            "author_url" : "https://www.google.com/maps/contrib/106481192371597721815/reviews",\n            "language" : "en",\n            "rating" : 5,\n            "relative_time_description" : "9 months ago",\n            "text" : "My husband & I have been using Chase bank for many years. When someone hacks our account, they call us the same day! We  don''t like their website that much, nor going into the bank. But the overall service of the bank on the phone and running our accounts is excellant. Since we have direct deposit, we never have any issues.",\n            "time" : 1458929188\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Mike DesRuisseau",\n            "author_url" : "https://www.google.com/maps/contrib/107718450597568663703/reviews",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "6 months ago",\n            "text" : "Maribel Ruelas is horrible teller and has absolutely horrible customer servive i feel like she try to scold me like a kid for not reading something i knew information for. I am owner of a local business and this is not how treat people....",\n            "time" : 1466439069\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Glen Payne",\n            "author_url" : "https://www.google.com/maps/contrib/116900113443619192923/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-Rhbd4GDRmyA/AAAAAAAAAAI/AAAAAAAABLs/0sVzny8U6Pw/photo.jpg",\n            "rating" : 1,\n            "relative_time_description" : "7 months ago",\n            "text" : "The tellers are nice, but they never have enough staff. ",\n            "time" : 1462147860\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "bank", "atm", "finance", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=8857913814991484505",\n      "utc_offset" : -480,\n      "vicinity" : "115 West Center Street, Manteca",\n      "website" : "https://locator.chase.com/search?q=95336&jp_cmp=rb/LocalListings/aff/branch/na"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL, NULL, 'ChIJnU2KSE1AkIARWbaX-a6h7Xo', 37.799314, -121.217567, 1, 0, NULL, 0, 'chase-bank/ChIJnU2KSE1AkIARWbaX-a6h7Xo', 0, '2016-12-26 07:44:31'),
