 and phone accessories. \\n\\nWalgreens is not only a Community Market that provides photography film printing services, and also provides to our public community things like sexual safety & pregnancy prevention products like \\"Plan B, lubricated condoms, and also feminine products like: pads & tampons, we also provide clinic services outside of our compound pharmacy assistance that is available pretty much 24-7! In all minuette cities. \\n\\n\\"Perhaps Walgreens should invest in an upgrade in staff with this reccomendation of review for the public. Security should be the mindset of Walgreens'' Pharmacy for the coming future. Considering their ability to grow in expanse and stay in growth rate without a drop into the future & beyond.\\" -Christen\\n\\n",\n            "time" : 1453506157\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Allison Montana",\n            "author_url" : "https://www.google.com/maps/contrib/111992931244135036328/reviews",\n            "language" : "en",\n            "rating" : 4,\n            "relative_time_description" : "a year ago",\n            "text" : "I was having a hard time with Costco and my insurance card. Walgreen was able to figure it out immediately. However, they told me my insurance didn''t cover the meds and with would be over $500. I asked the tech if there was a generic they could fill, and he said no. Moments later my doctor called in the generic that they \\"didn''t have\\" and had my script filled within minutes. The staff were very pleasant but possibly just need more time and training in the field. ",\n            "time" : 1441816222\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "AgustÃ­n Ramos",\n          