/maps/contrib/107887429029653379255/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-Jx7ekKMcEEc/AAAAAAAAAAI/AAAAAAAAACE/h76hUBcHtuE/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "a week ago",\n            "text" : "15.00 for a haircut!!!!! Why not. Been here 3x. Ive had 3 different stylists and they have not let me down. They do Rainbow colors too!",\n            "time" : 1481837004\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 0,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Stephy Romero",\n            "author_url" : "https://www.google.com/maps/contrib/104721965519935031967/reviews",\n            "language" : "en",\n            "rating" : 1,\n            "relative_time_description" : "4 months ago",\n            "text" : "Don''t ever return stuff here. I returned a simple little item and none of the girls knew how to return it. I waited almost a hour. Then when they \\"thought\\" they figured it out, they said it was returned and gave me my original receipt. I never signed anything. A week later I never seen my credit. Called to see what was the issue and if it really did get returned. They girl who answered said I needed to talk to Maria, the manager. She than told me I had to wait til Friday which would have been 7 business days. Okay fine. I waited til Saturday ...no credit. Called my bank...no pending credits for that business nor credit back to me. Called and spoke to Maria again, she said she would call corporate and call me back in a hour. Never did. Its now Monday. Wtf?! Can I just get my $20.00 back or give me back my product I returned. You can''t have both. Never go here !!!! They''re a joke.",\n            "time" : 1471265500\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Victor Centeno",\n            "author_url" : "https://www.google.com/maps/contrib/109204420280941959689/reviews",\n            "language" : "en",\n            "rating" : 4,\n            "relative_time_description" : "2 weeks ago",\n            "text" : "Good service, timely appointments vary, walk ins wait time can vary as well.",\n            "time" : 1481402794\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Sheila Mcclain",\n            "author_url" : "https://www.google.com/maps/contrib/114177327713804401016/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh5.googleusercontent.com/-VNZAzNok9Y0/AAAAAAAAAAI/AAAAAAAAI3w/dYkODXiCEq4/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "2 months ago",\n            "text" : "Kirby Butler creates the perfect haircut and makes you feel pampered! Go see her!!",\n            "time" : 1477353444\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Adrian Conures",\n            "author_url" : "https://www.google.com/maps/contrib/117439234412788039813/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-RIHK9g0SuJY/AAAAAAAAAAI/AAAAAAAAAL4/u3G8wSWZDsI/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "2 months ago",\n            "text" : "",\n            "time" : 1476743960\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [\n         "beauty_salon",\n         "hair_care",\n         "health",\n         "point_of_interest",\n         "establishment"\n      ],\n      "url" : "https://map