com/-bGyBw2hSMYY/AAAAAAAAAAI/AAAAAAAADy4/yqw0g9yFZRQ/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "3 months ago",\n            "text" : "Absolute love and enjoy this Starbucks. I was helped by Ariana. She always gives me the best customer service I have ever experienced. She is consistent in making my favorite drink, dopio espresso over ice with 2 pumps of vanilla topped with half and half. Definitely coming back for more",\n            "time" : 1473829243\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Elaine Conley",\n            "author_url" : "https://www.google.com/maps/contrib/105123241770724000752/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh6.googleusercontent.com/-sgyDlwdnp5I/AAAAAAAAAAI/AAAAAAAAAAk/QRWX23mah_Y/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "3 months ago",\n            "text" : "Love their friendly service and tasty coffee. The atmosphere is relaxing and welcoming. Thumb up!",\n            "time" : 1472755329\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Stephanie Marie",\n            "author_url" : "https://www.google.com/maps/contrib/115257288444813169132/reviews",\n            "language" : "en",\n            "rating" : 4,\n            "relative_time_description" : "3 months ago",\n            "text" : "Great coffee great atmosphere. Only complaint is employees are soooo slow. Not very upbeat like a \\"typical\\" starbucks. Very nice and good service. They just dont seem very motivated:/",\n            "time" : 1472919025\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 3,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Nick Briggs",\n            "author_url" : "https://www.google.com/maps/contrib/103906979959822871971/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-fi1tmdWqdj0/AAAAAAAAAAI/AAAAAAAAADE/4pxQu41JOpc/photo.jpg",\n            "rating" : 5,\n            "relative_time_description" : "5 months ago",\n            "text" : "Pretty big inside, some big tables where lots of people can gather. Very friendly staff. Nice outdoor seating area.",\n            "time" : 1469725937\n         },\n         {\n            "aspects" : [\n               {\n                  "rating" : 2,\n                  "type" : "overall"\n               }\n            ],\n            "author_name" : "Matthew Morgan",\n            "author_url" : "https://www.google.com/maps/contrib/105212085619173720764/reviews",\n            "language" : "en",\n            "profile_photo_url" : "//lh4.googleusercontent.com/-rj0ZOv44AKQ/AAAAAAAAAAI/AAAAAAAAB1E/2RTwc8G7Xio/photo.jpg",\n            "rating" : 4,\n            "relative_time_description" : "5 months ago",\n            "text" : "Please teach your baristas how to pull shots, 200Â° shots directly poured into plastic melts parts of it into the dink.  Barista totally was happy to remake my beverage when I pointed it out.  Ive heard managers in the area are training baristas to pull shots directly into cups, sad. Thank you team for making the customer happy! Excellent customer service!",\n            "time" : 1467854356\n         }\n      ],\n      "scope" : "GOOGLE",\n      "types" : [ "cafe", "food", "store", "point_of_interest", "establishment" ],\n      "url" : "https://maps.google.com/?cid=933201872962596543",\n      "utc_offset" : -480,\n      "vicinity" : "2168 Daniels Street, Manteca",\n      "website" : "http://www.starbucks.com/store/18216/"\n   },\n   "status" : "OK"\n}\n', NULL, NULL, NULL,